import React from 'react'

const GetInTouch = () => {
  return (
    <div className='max-w-5xl mx-auto mt-16'>
      <div className="flex justify-between">
        <h1><span>What</span> are you waiting for?</h1>
      </div>
    </div>
  )
}

export default GetInTouch
